  "title": {
    "nb": "Tungmetaller og andre uorganiske miljøelementer i marine sedimenter"
  },
  "description": {
    "nb": "Datasettet viser innholdet av tungmetaller og andre uorganiske miljøelementer (inkludert svovel, barium, arsen), samt mengden av mikroplastpartikler i marine sedimenter. I tillegg gir datasettet informasjon om kornstørrelsessammensetning, innhold av organisk karbon og karbonat. Sedimentprøver for geokjemiske analyser er hentet primært fra områder med finkornete sedimenter både i åpne marine avsetningsmiljøer og kystnære havområder. Prøvetettheten varierer avhengig av lokalisering. Det er større prøvetetthet i fjorder og kystnære områder, mens det i åpne havområder er lavere prøvetetthet."
  },
