  "title": {
    "nb": "INSPIRE Hydrography - Physical Waters"
  },
  "description": {
    "nb": "Hydrography in the context of this data specification is involved with the description of the sea, lakes, rivers and other waters, with their phenomena and all hydrographic-related elements. For mapping purposes, it includes a representation of physical elements – both natural and artificial. For reporting requirements of EC water-related directives it includes WFD surface water bodies. For spatial analysis and modelling, it includes a topologically-sound network of rivers and canals."
  },
