  },
  "description": {
    "nb": "HARMONIE-AROME is a convection-permitting atmosphere ensemble model covering the Scandinavian penninsula. It is run in operational routine at Meteorologisk institutt (MET Norway).\n\nThe model code is based on HARMONIE cy38h1.2.\nHARMONIE (Hirlam Aladin Regional/Meso-scale Operational NWP In Europe) is a cooperation including Meteo-France and their Aladin partners, the Hirlam group and also ECMWF with their IFS (Integrated Forecasting System) model."
  },
