  "description": {
    "nb": "Helsenorge.no er den offentlige, innbyggerrettede helseportalen. Den drives av Direktoratet for e-helse. Dette grensesnittet tilgjengeliggjør søk i alt redaksjonelt innhold i Helsenorge.no for programmatisk aksess. Følg Helsenorge.no på bloggen helsenorgebeta.net."
