  "description": {
    "nb": "Valutaregisteret inneholder opplysninger om valutaveksling og overføring av betalingsmidler inn og ut av Norge. Dette gjelder blant annet kortbruk i utlandet, og kontanter du tar med deg inn eller ut av Norge som du har deklarert til Tolletaten.\n\nBanker, finansinstitusjoner og betalingsforetak i Norge som har fått konsesjon eller tillatelse fra Finanstilsynet er rapporteringspliktige til Valutaregisteret"
  },
